var wecai = {}
wecai.__Ajax__ = function(obj) {

  var type = (obj.type || 'GET').toUpperCase();
  var async = typeof obj.async == 'undefined' ? true : obj.async;
  var url = obj.url;
  var xhr = new XMLHttpRequest();
  var timer = null;
  var data = null;

  if (typeof obj.data == "object") {
    data = JSON.stringify(obj.data)
  } else {
    data = typeof obj.data == 'string' ? obj.data : null;
  }

  xhr.open(type, url, async);
  var _onreadystatechange = xhr.onreadystatechange;

  xhr.onreadystatechange = function() {

    if (typeof _onreadystatechange == 'function') {
      _onreadystatechange.apply(xhr);
    }
    if (xhr.readyState == 3) {
      obj.received && obj.received(xhr);
    }
    if (xhr.readyState == 4) {
      xhr.onreadystatechange = null;
      var status = xhr.status;
      if (status >= 200 && status < 400) {
        var responseText = xhr.responseText;
        var resp = responseText;
        if (obj.dataType == 'json') {
          try {
            resp = eval("(" + resp + ")");
          } catch (e) {
            obj.error && obj.error(xhr);
            return;
          }
        }
        obj.success && obj.success(resp);
      } else {
        obj.error && obj.error(xhr);
      }
      clearTimeout(timer);
      obj.complete && obj.complete();
      obj.complete = null;
    }
  };
  if (type == 'POST') {
    xhr.setRequestHeader("Content-Type", "application/json;charset=UTF-8");
  }
  xhr.setRequestHeader("X-Requested-With", "XMLHttpRequest");
  if (typeof obj.timeout != 'undefined') {
    timer = setTimeout(function() {
      xhr.abort("timeout");
      obj.complete && obj.complete();
      obj.complete = null;
    }, obj.timeout);
  }
  try {
    xhr.send(data);
  } catch (e) {
    obj.error && obj.error();
  }
}


var aJaxData = function(act,data) {
    return new Promise(function(resolve, reject) {
      wecai.__Ajax__({
        type: 'POST',
        dataType: 'json',
        url: 'http://127.0.0.1:6877/scraper?act='+act,
        data: data,
        success:(result)=>{
          resolve(result)
        },
        error:(err)=>{
          reject(err)
        }
      })
    })
  }

